import styled, { css } from 'styled-components'

import { PropertyItem } from '../components/PropertyItem'

const Container = styled.div`
  display: flex;
  flex-direction: column;
  margin: 2rem auto;
`

const setDisplay = css`
  display: initial;
`

const activeNotFound = props => {
  if (props.propertiesData) {
    return setDisplay
  }
  return
}

const NotFound = styled.h3`
  text-align: center;
  color: #fff;
  display: none;

  ${activeNotFound}
`

export const PropertiesList = ({ propertiesData }) => (
  <Container>
    {propertiesData ? (
      propertiesData.map((item, index) => (
        <PropertyItem key={index} item={item} />
      ))
    ) : (
      <NotFound propertiesData>Property not found</NotFound>
    )}
  </Container>
)
